      const output = `${photoResult.body} ${firstName} ${lastName}`;

      // Return the output to be used by the caller
      console.log(output);
    })
    .catch((error) => {
      // Log error message if any of the promises reject
      console.error('Signup system offline:', error.message);
      // Throw the error again to propagate it to the caller if necessary
      throw error;
    });
}

