          return {
            status: 'fulfilled',
            value: result.value,
          };
        }
        return {
          status: 'rejected',
          value: result.reason,
        };
      }))
    .catch((error) => {
      console.error('Error during profile signup:', error);
      throw error; // Rethrow error for further handling
    });
}

